jQuery(function (e) {
    'use strict';
    (function () {
      e(document.body).on(
        'change',
        '#woocommerce_tbz_payfi_testmode',
        function () {
          var t = e('#woocommerce_tbz_payfi_test_public_key').parents('tr').eq(0),
            o = e('#woocommerce_tbz_payfi_test_secret_key').parents('tr').eq(0),
            _ = e('#woocommerce_tbz_payfi_live_public_key').parents('tr').eq(0),
            c = e('#woocommerce_tbz_payfi_live_secret_key').parents('tr').eq(0);
          e(this).is(':checked')
            ? (t.show(), o.show(), _.hide(), c.hide())
            : (t.hide(), o.hide(), _.show(), c.show());
        }
      ),
        e('#woocommerce_tbz_payfi_testmode').change();
    })();
  });
  